import React from 'react';
import './Button.css';

const OperatorButton = props => {
  return (
    <div className="col-md-2 col-height d-flex justify-content-center d-flex align-items-center border border-left-0">
      {props.operator}
    </div>
  );
};

export default OperatorButton;
